import React, { Component } from "react";

class Stuff extends Component {
  render() {
    return (
      <div>
       <p>These are the currently used tools ....</p>
        <ol>
          <li>ECS</li>
          <li>FarGate</li>
          <li>And more....</li>
        </ol>
      </div>
    );
  }
}

export default Stuff;
